import React, { Component } from 'react';

class Nav extends Component {
    render() {
        return (
            <nav class="bg-white px-8 pt-2 shadow-md">
                <div class="-mb-px flex">
                    <a className="no-underline text-teal-dark border-b-2 border-teal-dark uppercase tracking-wide font-bold text-xs py-3 mr-8" href="http://sudrihack.com">Sudrihack</a>
                    <a class="no-underline text-teal-dark border-b-2 border-teal-dark uppercase tracking-wide font-bold text-xs py-3 mr-8" href="#">
                        Home
                    </a>
                    <a class="no-underline text-grey-dark border-b-2 border-transparent uppercase tracking-wide font-bold text-xs py-3 mr-8" href="#">
                        Products
                    </a>
                    <a class="no-underline text-grey-dark border-b-2 border-transparent uppercase tracking-wide font-bold text-xs py-3 mr-8" href="#">
                        Discounts
                    </a>
                    <a class="no-underline text-grey-dark border-b-2 border-transparent uppercase tracking-wide font-bold text-xs py-3" href="#">
                        Customers
                    </a>
                <Searchbar />
                </div>

            </nav>
        );
    }
}

class Searchbar extends Component {
    render() {
        return (
            <span class="w-screen md:w-1/3 h-10 bg-gray-200 cursor-pointer border border-gray-300 text-sm rounded-full flex">
                <input type="search" name="serch" placeholder="Search" 
                    class="flex-grow px-4 rounded-l-full rounded-r-full text-sm focus:outline-none" />
                <i class="fas fa-search m-3 mr-5 text-lg text-gray-700 w-4 h-4">
                </i>
            </span>
        );
    }
}

export default Nav;
